import React from "react";
import { Link } from "react-router-dom";
import "./note.css";

const Note = ({ title, paragraph, className }) => {
  return (
    <div className={`${className} content-main`}>
      <div className={` content-box`}>
        <h2>{title}</h2>
        <p>{paragraph}</p>
        <Link to="/start" className="">
          Go back
        </Link>
      </div>
    </div>
  );
};

export default Note;
